testCollisionRectRect = function (rect1, rect2) {
  return (
    rect1.x <= rect2.x + rect2.width &&
    rect2.x <= rect1.x + rect1.width &&
    rect1.y <= rect2.y + rect2.height &&
    rect2.y <= rect1.y + rect1.height
  );
};

document.onmousedown = function (mouse) {
  if (mouse.which === 1) player.pressingMouseLeft = true;
  else player.pressingMouseRight = true;
};
document.onmouseup = function (mouse) {
  if (mouse.which === 1) player.pressingMouseLeft = false;
  else player.pressingMouseRight = false;
};
document.oncontextmenu = function (mouse) {
  mouse.preventDefault();
};
document.onclick = function (mouse) {
  var mouseX = mouse.clientX - canvas.getBoundingClientRect().left;
  var mouseY = mouse.clientY - canvas.getBoundingClientRect().top;

  mouseX -= CANVAS_WIDTH / 2;
  mouseY -= CANVAS_HEIGHT / 2;

  player.aimAngle = (Math.atan2(mouseY, mouseX) / Math.PI) * 180;
  player.performAttack();
};

document.onkeydown = function (event) {
  if (event.keyCode === 68)
    //d
    player.pressingRight = true;
  else if (event.keyCode === 83)
    //s
    player.pressingDown = true;
  else if (event.keyCode === 65)
    //a
    player.pressingLeft = true;
  else if (event.keyCode === 87)
    // w
    player.pressingUp = true;
  else if (event.keyCode === 80)
    //p
    paused = !paused;
};

document.onkeyup = function (event) {
  if (event.keyCode === 68)
    //d
    player.pressingRight = false;
  else if (event.keyCode === 83)
    //s
    player.pressingDown = false;
  else if (event.keyCode === 65)
    //a
    player.pressingLeft = false;
  else if (event.keyCode === 87)
    // w
    player.pressingUp = false;
};

update = function () {
  if (paused) {
    ctx.fillStyle = "red";
    ctx.fillText("PAUSED", WIDTH / 2 - 60, HEIGHT / 2 - 100);
    islandmusic.stop();
    return;
  } else {
    islandmusic.play();
  }
  if (playerwin)
  {

    ctx.fillStyle = "#B69385";
    ctx.fillRect(30, 40, 538, 587);
    ctx.fillStyle = "#825C4D";
    ctx.fillRect(9, 9, 540, 600);
    ctx.fillStyle = "#E6E6E6";
    ctx.font = "30px Georgia";
    islandmusic.stop();
    ctx.fillText(
      "CONGRATULATIONS !   YOU WIN ! ",
      WIDTH / 2 - 650,
      HEIGHT / 2 - 300
    );

    ctx.font = "25px Georgia";
    ctx.fillStyle = "#E6E6E6";
    ctx.fillText(
      "     Collected Rings  : " + collectdiamond + " x " + " 100",
      WIDTH / 2 - 670,
      HEIGHT / 2 - 220
    );

    ctx.font = "25px Georgia";
    ctx.fillStyle = "#E6E6E6";
    ctx.fillText(
      "     Collected Rubies  : " + collectruby + " x " + " 250",
      WIDTH / 2 - 670,
      HEIGHT / 2 - 170
    );

    ctx.font = "25px Georgia";
    ctx.fillStyle = "#E6E6E6";
    ctx.fillText(
      "     Collected Diamonds  : " + collectring + " x " + " 400",
      WIDTH / 2 - 670,
      HEIGHT / 2 - 120
    );

    ctx.font = "25px Georgia";
    ctx.fillText(
      "     Dead Stone Golems  : " + killgolem + " x " + " 50",
      WIDTH / 2 - 670,
      HEIGHT / 2 - 70
    );

    ctx.font = "25px Georgia";
    ctx.fillText(
      "     Dead Golden Golems  : " + killgoldengolem + " x " + " 250",
      WIDTH / 2 - 670,
      HEIGHT / 2 - 20
    );

    ctx.font = "25px Georgia";
    ctx.fillText(
      "     Dead Boss  Golem  : " + killboss + " x " + " 1000",
      WIDTH / 2 - 670,
      HEIGHT / 2 + 30
    );

    ctx.fillStyle = "#E6E6E6";
    ctx.font = "28px Georgia";
    ctx.fillText(
      "------------------------------------ ",
      WIDTH / 2 - 640,
      HEIGHT / 2 + 90
    );

    ctx.fillStyle = "#E6E6E6";
    ctx.font = "30px Georgia";
    ctx.fillText(
      "     Your Total Score is : " + score,
      WIDTH / 2 - 670,
      HEIGHT / 2 + 140
    );

    ctx.fillStyle = "#E6E6E6";
    ctx.font = "15px Georgia";
    ctx.fillText("Created by Jashin", WIDTH / 2 - 460, HEIGHT / 2 + 220);

    return;
  }

  ctx.clearRect(0, 0, WIDTH, HEIGHT);

  Maps.current.draw();
  frameCount++;

  EnemyStatic.update();
  GoldEnemy.update();
  BossEnemy.update();
  Stonewall.update();
  TheGirl.update();
  Bullet.update();
  BulletEnemy.update();
  GoldBullet.update();
  BossBullet.update();
  Upgrade.update();

  //Upgrade.staticGenerate();    not just one time func.

  player.update();

  ctx.strokeStyle = "black";
  ctx.strokeRect(10, 10, 350, 40);

  ctx.fillStyle = "#B69385";
  ctx.fillRect(10, 10, 350, 40);
  ctx.fillStyle = "#825C4D";
  ctx.fillRect(13, 13, 344, 34);

  ctx.save();
  ctx.fillStyle = "#40ff40";
  ctx.fillRect(75, 20, player.hp * 10, 20);

  ctx.strokeStyle = "black";
  ctx.strokeRect(75, 20, 100, 20);

  ctx.restore();
  ctx.fillStyle = "#40ff40";
  ctx.fillText("Hp: ", 20, 40);
  ctx.fillStyle = "#E6E6E6";
  ctx.fillText("Score: " + score, 190, 40);
};

function sound(src) {
  this.sound = document.createElement("audio");
  this.sound.src = src;
  this.sound.setAttribute("preload", "auto");
  this.sound.setAttribute("controls", "none");
  this.sound.style.display = "none";
  document.body.appendChild(this.sound);
  this.play = function () {
    this.sound.play();
  };
  this.stop = function () {
    this.sound.pause();
  };
}

